import React, { useState } from "react";
import ReactDOM from "react-dom";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from "react-router-dom";

import './style.css';
import './style2.css';

import LoginP from './main/login';
import Main from './main/main';
  
function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/login" component={LoginP} />
          <Route path="/main" component={Main} />
          <Redirect to="/" />
        </Switch>
      </Router>
    </>
  );
}

const Home = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <br />
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/login">About</Link>
        </li>
        <li>
          <Link to="/main">Contact Us</Link>
        </li>
      </ul>
    </div>
  );
};
  
export default Home;
